  \"2015-01-22T17:42:39.336504\",\n\t\"name\": \"tiger-line-shapefile-2012-series-information-file-for-the-current-block-state-baseds\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. Census Blocks are statistical areas bounded on all sides by visible features,
  such as streets,n               roads, streams, and railroad tracks, and/or by non-visible
  boundaries such as city, town, township, and county limits, and short line-of-sight
  extensionsn               of streets and roads. Census blocks are relatively small
  in area; for example, a block in a city bounded by streets. However, census blocks
  in remoten               areas are often large and irregular and may even be many
  square miles in area. A common misunderstanding is that data users think census
  blocks are usedn               geographically to build all other census geographic
  areas, rather all other census geographic areas are updated and then used as the
  primary constraints,n               along with roads and water features, to delineate
  the tabulation blocks. As a result, all 2010 Census blocks nest within every other
  2010 Censusn               geographic area, so that Census Bureau statistical data
  can be tabulated at the block level and aggregated up to the appropriate geographic
  areas. Censusn               blocks cover all territory in the United States, Puerto
  Rico, and the Island Areas (American Samoa, Guam, the Commonwealth of the Northern
  Marianan               Islands, and the U.S. Virgin Islands). Blocks are the smallest
  geographic areas for which the Census Bureau publishes data from the decennial census.
  An               block may consist of one or more faces.\",\n\t\"license_title\":
